import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus, faFilePdf } from '@fortawesome/free-solid-svg-icons';
import Sidebar from './Sidebar';
import TransactionsTable from './TransactionsTable';
import TransactionForm from './TransactionForm';
import './Dashboard.css';

const Dashboard = () => {
  const [activeMenu, setActiveMenu] = useState('dashboard');
  const [transactions, setTransactions] = useState([]);
  const [showTransactionForm, setShowTransactionForm] = useState(false);
  const [transactionToEdit, setTransactionToEdit] = useState(null);
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [formError, setFormError] = useState('');
  const navigate = useNavigate();

  // Load transactions when component mounts
  useEffect(() => {
    const fetchTransactions = async () => {
      const token = localStorage.getItem('access_token');
      if (!token) {
        navigate('/login');
        return;
      }

      try {
        const response = await axios.get('http://localhost:8000/api/transactions/', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setTransactions(response.data);
      } catch (error) {
        console.error('Error fetching transactions:', error);
      }
    };

    fetchTransactions();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('access_token');
    navigate('/login');
  };

  // Handle form submission for both add and edit
  const handleTransactionSubmit = async (transactionData) => {
    const token = localStorage.getItem('access_token');
    setIsSubmitting(true);
    
    try {
      if (transactionToEdit) {
        // Update existing transaction
        await axios.put(
          `http://localhost:8000/api/transactions/${transactionToEdit.id}/`,
          transactionData,
          { headers: { Authorization: `Bearer ${token}` } }
        );
      } else {
        // Create new transaction
        await axios.post(
          'http://localhost:8000/api/transactions/',
          transactionData,
          { headers: { Authorization: `Bearer ${token}` } }
        );
      }
      
      // Refresh transactions after successful submit
      const response = await axios.get('http://localhost:8000/api/transactions/', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTransactions(response.data);
      
      setShowTransactionForm(false);
      setTransactionToEdit(null);
    } catch (error) {
      setFormError(error.response?.data?.detail || 'Failed to save transaction');
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleEditTransaction = (transaction) => {
    setTransactionToEdit(transaction);
    setShowTransactionForm(true);
  };

  const handleDeleteTransaction = async (transactionId) => {
    const token = localStorage.getItem('access_token');
    try {
      await axios.delete(
        `http://localhost:8000/api/transactions/${transactionId}/`, 
        { headers: { Authorization: `Bearer ${token}` } }
      );
      // Refresh transactions after delete
      const response = await axios.get('http://localhost:8000/api/transactions/', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setTransactions(response.data);
    } catch (error) {
      console.error('Error deleting transaction:', error);
      alert('Failed to delete transaction. Please try again.');
    }
  };

  return (
    <div className="dashboard-container">
      <Sidebar 
        activeMenu={activeMenu} 
        setActiveMenu={setActiveMenu} 
        handleLogout={handleLogout}
      />

      <div className="main-content">
        <div className="content-header">
          <h1>{activeMenu.charAt(0).toUpperCase() + activeMenu.slice(1)}</h1>
          <div className="header-actions">
            {activeMenu === 'expenses' && (
              <button 
                className="btn btn-primary"
                onClick={() => {
                  setTransactionToEdit(null);
                  setShowTransactionForm(true);
                }}
                disabled={isSubmitting}
              >
                <FontAwesomeIcon icon={faPlus} /> 
                {isSubmitting ? 'Processing...' : 'Add Transaction'}
              </button>
            )}
          </div>
        </div>

        {activeMenu === 'dashboard' && (
          <div>
            <h2>Welcome to Your Dashboard</h2>
            <TransactionsTable 
              transactions={transactions}
              onEdit={handleEditTransaction}
              onDelete={handleDeleteTransaction}
            />
          </div>
        )}

        {activeMenu === 'expenses' && (
          <TransactionsTable 
            transactions={transactions.filter(t => t.type === 'expense')}
            onEdit={handleEditTransaction}
            onDelete={handleDeleteTransaction}
          />
        )}
      </div>

      {showTransactionForm && (
        <TransactionForm 
          isOpen={showTransactionForm}
          onClose={() => {
            if (!isSubmitting) {
              setShowTransactionForm(false);
              setTransactionToEdit(null);
            }
          }}
          onSubmit={handleTransactionSubmit}
          initialData={transactionToEdit}
          isSubmitting={isSubmitting}
          error={formError}
          categories={[
            'food', 'transportation', 'housing',
            'entertainment', 'utilities', 'health',
            'education', 'other'
          ]}
        />
      )}
    </div>
  );
};

export default Dashboard;
